import React from "react";

export const Navbar = () => {
  return (
    <nav className=" pr-60 bg-yellow-800">
      <div className="w-full flex justify-between py-5">
        <p className="cust-font text-3xl">Natasha & Manuel</p>
        <div className="nav-list">
          <ul className="flex space-x-8 text-[0.8rem]">
            <li>About</li>
            <li>Gallery</li>
            <li>Guestbook</li>
            <li>Livestream</li>
          </ul>
        </div>
      </div>
    </nav>
  );
};
